import React from 'react';
import '../styles.css';
import PageSetup from '../components/pageSetup';

import noConnection from '../image/astronaut.jpg';

const noPage = ({navBar}) => { 
    return(<PageSetup generalTitle="Raide Energy" pageTitle="Página no encontrada">
        <img src={noConnection} style={{height: "200px", marginRight: "auto"}}/>
        <div style={{textAlign: "left", fontSize: "20px", position: "relative", top: "100px", padding: "100px"}}>
            {"Página no encontrada"}
        </div>
    </PageSetup>) 
}

export default noPage;
